import{d as e,i as t,b as o}from"./vue.e4a38e5d.js";var i={html:'<h1 id="vue-3--typescript--vite">Vue 3 + Typescript + Vite</h1>\n<p>This template should help get you started developing with Vue 3 and Typescript in Vite.</p>\n<h2 id="recommended-ide-setup">Recommended IDE Setup</h2>\n<p><a href="https://code.visualstudio.com/">VSCode</a> + <a href="https://marketplace.visualstudio.com/items?itemName=octref.vetur">Vetur</a>. Make sure to enable <code>vetur.experimental.templateInterpolationService</code> in settings!</p>\n<h3 id="if-using-script-setup">If Using <code>&lt;script setup&gt;</code></h3>\n<p><a href="https://github.com/vuejs/rfcs/pull/227"><code>&lt;script setup&gt;</code></a> is a feature that is currently in RFC stage. To get proper IDE support for the syntax, use <a href="https://marketplace.visualstudio.com/items?itemName=johnsoncodehk.volar">Volar</a> instead of Vetur (and disable Vetur).</p>\n<h2 id="type-support-for-vue-imports-in-ts">Type Support For <code>.vue</code> Imports in TS</h2>\n<p>Since TypeScript cannot handle type information for <code>.vue</code> imports, they are shimmed to be a generic Vue component type by default. In most cases this is fine if you don\'t really care about component prop types outside of templates. However, if you wish to get actual prop types in <code>.vue</code> imports (for example to get props validation when using manual <code>h(...)</code> calls), you can use the following:</p>\n<h3 id="if-using-volar">If Using Volar</h3>\n<p>Run <code>Volar: Switch TS Plugin on/off</code> from VSCode command palette.</p>\n<h3 id="if-using-vetur">If Using Vetur</h3>\n<ol>\n<li>Install and add <code>@vuedx/typescript-plugin-vue</code> to the <a href="https://www.typescriptlang.org/tsconfig#plugins">plugins section</a> in <code>tsconfig.json</code></li>\n<li>Delete <code>src/shims-vue.d.ts</code> as it is no longer needed to provide module info to Typescript</li>\n<li>Open <code>src/main.ts</code> in VSCode</li>\n<li>Open the VSCode command palette</li>\n<li>Search and run "Select TypeScript version" -&gt; "Use workspace version"</li>\n</ol>',metadata:{},filename:"test.md",path:"/Users/sunwenlong/Self/Code/10-MyGit/swlws.github.io/packages/site-client/src/assets/doc/test.md"},s=e({setup:()=>({doc:i.html})});s.render=function(e,i,s,n,p,a){return t(),o("div",{class:"markdown-body",innerHTML:e.doc},null,8,["innerHTML"])};export default s;
